import React from "react";
import "./App.css";
import Sidebar from "./Components/Sidebar";
import Main from "./Components/Main";

function App() {
  return (
    <div className="App wrapper">
      <Sidebar></Sidebar>
      <Main></Main>
    </div>
  );
}

export default App;
